full_reasoning:
Step 1: Reasoning

• Psychological Mechanisms: Responders care not only about the money they receive (split_self) but also about whether the offer is fair given their pretask “tokens” outcome. Fairness is assessed relative to a norm in which each participant’s entitled share is proportional to the number of tokens they found (token_self relative to the total tokens earned by both, token_self + token_opp). When the offer is below this entitlement, responders experience a disutility proportional to the shortfall (inequity aversion). When the offer meets or exceeds the entitlement, no fairness punishment applies.

• How Mechanisms Interact: The overall utility of accepting an offer is assumed to be a linear combination of the monetary gain and a fairness term that penalizes offers falling below a fairness reference point (equal to the entitled share of the combined_earning).

• Mathematical Form: Let the fairness reference be defined as 
  fair_share = (token_self/(token_self + token_opp)) × combined_earning.
The utility of accepting an offer then combines a scaled monetary reward (β × split_self) and subtracts a penalty given by the inequity aversion parameter (λ) multiplied by the positive fairness shortfall max(fair_share − split_self, 0).

• Parameters Needed:
 – β (beta): scales the effectiveness of the monetary gain.
 – λ (lambda_param): scales disutility for receiving less than the fair share.
Both are learnable parameters with generous but finite bounds.

• Mapping to Observable Behavior:
 – The observable action is acceptance of an offer; our model calculates the utility of that acceptance based on the offered split (split_self), the tokens (token_self and token_opp), and the total amount available (combined_earning).
 – A higher utility corresponds to a higher probability (post temperature transformation) to accept the offer. Negative utility indicates an unlikely acceptance.

Below is the formal specification.

<MODEL>
U = beta * split_self - lambda_param * max((token_self/(token_self + token_opp)) * combined_earning - split_self, 0)
</MODEL>

